import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Dashboard = () => {
  const [user, setUser] = useState(null); // State untuk menyimpan data user
  const [error, setError] = useState(null); // State untuk menyimpan error jika ada

  useEffect(() => {
    const fetchSession = async () => {
      try {
        const response = await axios.get('/api/session'); // Endpoint backend untuk data session
        setUser(response.data); // Simpan data session ke state
      } catch (err) {
        console.error('Error fetching session:', err);
        setError(err.response?.data?.message || 'Gagal memuat session');
      }
    };

    fetchSession(); // Panggil fungsi saat komponen mount
  }, []);

  if (error) return <p>{error}</p>; // Tampilkan error jika ada
  if (!user) return <p>Loading...</p>; // Tampilkan loading jika user belum ada

  return (
    <div>
      <h1>Selamat Datang, {user.username}</h1>
      <p>Anda login sebagai {user.role}.</p>
    </div>
  );
};

export default Dashboard;
